Hace unos d√≠as @diego_sinazucar_chef me propuso hacer un reto (#retomacaronsketo) para hacer macarons keto. Este es mi 3er intento y si bien no han quedado perfectos como los tradicionales, en textura y look, es lo mejor que consegu√≠ hacer, considerando que no lleva az√∫car (que juega un papel importante en la textura y el look de un macaron tradicional). Pero igual est√°n muy ricos! ‚ò∫Ô∏è‚Å£
‚Å£
