Aqu√≠ dejo la receta üëá‚Å£
‚Å£
‚ñ™Ô∏èINGREDIENTES ‚Å£
‚Å£
Macaron:‚Å£
- 4 claras de huevo‚Å£
- 50g de harina de almendras‚Å£
- 2g de matcha culinaria‚Å£
- 5 cdas de Lakanto Maple Syrup (√≥ cualquiera sin az√∫car)‚Å£
- 8 gotitas de stevia (opcional - para extra dulzor)‚Å£
- 1/4 cdta de goma xantana (importante)‚Å£
‚Å£
Relleno:‚Å£
- 70g de queso crema‚Å£
- 50g de crema de leche‚Å£
- 20g de Lakanto en polvo √≥ eritritol en polvo (se puede pulverizar en la licuadora)‚Å£
‚Å£
‚ñ™Ô∏è PREPARACI√ìN ‚Å£
‚Å£
1. Precalienta el horno a 140 grados C.‚Å£
2. En una sart√©n chica a fuego lento pon el syrup con la stevia y la goma xantana. Mezcla y cuando est√© caliente, pero no hirviendo, ret√≠ralo del fuego.‚Å£
3. Empieza a batir 2 claras a punto de nieve y cuando est√©n a medio montar agrega la mezcla del syrup de a pocos y termina de batir.‚Å£
4. Aparte en un bowl cierne la harina y la matcha, mezcla y agrega las 2 claras restantes. Mezcla hasta que se cree una pasta. Agrega las claras batidas y mezcla todo con una esp√°tula. ‚Å£
5. Pon la mezcla en una manga, o bolsa ziploc si no tuvieses, y en un baking pad (no papel manteca porque se pega) formar los macarons. Recomiendo ver un video en YouTube para esta parte. ‚Å£
6. Deja reposar los macarons crudos 20 minutos antes de hornear. Hornea por 12-15 minutos. S√°calos y deja reposar antes de sacarlos. ‚Å£
7. Para el relleno bate todos los ingredientes y con una manga rellena los macarons como alfajores. Y listo!‚Å£
